function getComplexLevel(str,startTag,endTag){const regex=new RegExp(`${startTag}(.*?)${endTag}`,"g"),extractedContent=[];let match,newStr=str;for(;null!==(match=regex.exec(str));){const content=match[1];extractedContent.includes(content)||extractedContent.push(content),newStr=newStr.replace(match[0],"")}return{content:extractedContent,edited:newStr}}module.exports=getComplexLevel;